import React from 'react';

const Dashboard = () => {
  return (
    <div style={{
      fontFamily: 'Arial',
      display: 'flex',
      height: '100vh',
      justifyContent: 'center',
      alignItems: 'center',
      flexDirection: 'column'
    }}>
      <h1>This is the starter dashboard</h1>
      <p>You successfully logged in.</p>
    </div>
  );
};

export default Dashboard;
